import React from "react";
import FavoriteActions from "./FavoriteActions";
//import { Router,Route } from 'react-router';
import { Link } from "react-router-dom";
import { ListGroup, ListGroupItem } from 'reactstrap';

const Dog = ({
  id,
  name,
  toggle,
  getStatus,
}) => {
  return (
    <ListGroup>
    <ListGroupItem>
      <span
        style={{
          display: "inline-block",
          marginRight: "15px",
          maxHeight:"100px",
          maxWidth:"100px",
          height:"100px",
          width:"100px"
        
        }}
      >
          <img src={"https://dl5zpyw5k3jeb.cloudfront.net/photos/pets/46622526/1/?bust=1574186637&width=600"} alt="dog"></img>
        <Link to={`/detay/${id}/${name}`}>
          <h5>{name}</h5>
        </Link>
      </span>
      <FavoriteActions toggle={toggle} id={id} getStatus={getStatus} />
      </ListGroupItem>
    </ListGroup>
  );
};

export default Dog;
